import React from 'react';
import ParkCard from './ParkCard';

function ParkList ({ parks }){
  
    return (
      <ul className="cards">
        {parks.map((park) => {
        return <ParkCard key={park.id} plant={park}/>
        })}
        </ul>
    );
  }





  
export default ParkList;
